import React from "react";

export default function Media() {
  return (
    <div>
      <div className="container">
        <h1>Media</h1>
        <p>
          Are you a journalist, food blogger or work for news organization
          looking to cover a mission driven amazing company? Great,{" "}
          <a href="mailto:mavlonbek@tryfreshbox.com">email</a> us and we will be
          happy to discuss how we can partner together.
        </p>
      </div>
    </div>
  );
}
